import React, { Component } from "react";
import Aux from "../hoc/Auxiliary";
import "./cart.css";

class Cart extends Component {
  render() {
    return (
      <Aux>
        <h1>Your shopping cart</h1>
      </Aux>
    );
  }
}

export default Cart;
